import React from 'react';
import image from '../images/image2.jpg';
import Common from './Common';

const About = () => {
  return (
    <Common tagline={`Wanna Know About ${<br/>}`} name="US" img={image} imgstyle={{width:'600px' , height:'200px', backgroundColor:'red'}}/>
  )
}

export default About
